import './calendar/Calendar.css';

function App() {
  return (
    <div className="calendar_box">
            <div className="cal_header">
              <div className="menu_bar"></div>
              <div className="cal_title">ff</div>
            </div>
            <div className="cal_body">
              <table className="cal_list">
                <tbody>
                  <tr>
                    <th>월</th>
                  </tr>
                </tbody>
              </table>
            </div>
            <div className="cal_detail">
                    클릭했을때 일정 디테일 하게 보여주는거
            </div>


        </div>

  );
}

export default App;
